import React from 'react';
import "./landing.css";



function Landing() {
    return (
        <div className="landing">

            <div className="hero">

                <div className = "astrowheel-container">

                    <div className = "main-body">
                        <h1>StarSync</h1>
                        <h3>The sky, but in your pocket.</h3>

                    </div>

                        <img src = "astrowheel.png" alt="astrowheel"/>

                </div>

            </div>


        </div>
    )
}

export default Landing
